import React from "react";

const AudioPlayer = () => {
  return (
    <div>
      <h2>Audio Player</h2>
      <audio controls>
        <source src="./FEN.mp3" type="audio/mp3" />
        Your browser does not support the audio tag.
      </audio>
    </div>
  );
};

export default AudioPlayer;
